import { Card, CardContent, CardMedia } from "@mui/material";
import React from "react";

const CardItem = () => {
  return (
    <Card elevation={2}>
      <CardContent>
        <CardMedia />
      </CardContent>
    </Card>
  );
};

const ManageApp = () => {
  return <div>Manage App</div>;
};

export default ManageApp;
